/*

	Hello there! You might be wondering why there are two 'model' files,
	model-full and model-lite.

	The maps pages contain a number of Svelte components, which get rendered
	at build time so that they're there as soon as a reader lands on the page,
	instead of having to wait until JavaScript loads. Because of that, the JS
	for these components only runs in Node — there's no point running it in
	the browser as well. You can identify these components because in the
	Google doc they have `static: true`.

	But some components *do* need JS to run in the browser — at the time of
	writing, that's `heatmap`, `cases-by-state` and `cases-by-type` (i.e. the
	tables, which have a 'Show more' button). They don't have `static: true`.

	This project is importing a lot of data from the Google spreadsheet. At
	one point, all that data was being bundled into a JavaScript file, which
	a) causes build times to be extremely slow, and b) meant that the tables
	were dragging all that data into the browser, even though they only need
	a tiny fraction of it.

	So now we have two model files — model-full and model-lite. model-full
	contains everything, but rather than bundling the spreadsheet data, it
	reads it from the filesystem. This only works in Node — not the browser.

	model-lite contains just what's needed for interactive components to work.

	As the project grows, it's likely that we'll need to add new stuff to
	these modules. If you're unsure how to go about that, or have any questions
	about the best way to architect stuff, come find me on Slack.

	— Rich

*/
